const HR = () => {
    const employees = ["John", "Jane", "Mike", "Emily"];
    const clients = ["Apple", "Microsoft", "Google", "Amazon"];

    return (
        
        <div className="grid grid-cols-2 gap-4 border border-gray-500 p-4 text-center">
    
            <div className="uppercase">
                <h1>Employees</h1>
                <ul>
                    {employees.map((employee) => (
                        <li key={employee}>{employee}</li>
                    ))}
                </ul>
            </div>

            <div>
                <h1>Clients</h1>
                <ul>
                    {clients.map((client) => (
                        <li key={client}>{client}</li>
                    ))}
                </ul>
            </div>
        </div>
    );
};

export default HR;
